// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TokenSwap is Ownable {
    IERC20 public tokenX;
    IERC20 public tokenY;
    uint256 public exchangeRate; // Número de TokenY por TokenX

    event Swap(address indexed user, uint256 amountOfTokenX, uint256 amountOfTokenY);

    constructor(address _tokenXAddress, address _tokenYAddress, uint256 _exchangeRate) Ownable(msg.sender) {
        tokenX = IERC20(_tokenXAddress);
        tokenY = IERC20(_tokenYAddress);
        exchangeRate = _exchangeRate;
    }

    function swapTokens(uint256 amountOfTokenX) external {
        require(amountOfTokenX > 0, "A quantidade deve ser maior que zero");

        uint256 amountOfTokenY = amountOfTokenX * exchangeRate;

        // Verifica o saldo de tokenY no contrato
        uint256 contractTokenYBalance = tokenY.balanceOf(address(this));
        require(contractTokenYBalance >= amountOfTokenY, "O contrato nao tem TokenY suficiente");

        // Transfere TokenX do usuário para o contrato
        bool received = tokenX.transferFrom(msg.sender, address(this), amountOfTokenX);
        require(received, "Falha ao transferir TokenX para o contrato");

        // Transfere TokenY do contrato para o usuário
        bool sent = tokenY.transfer(msg.sender, amountOfTokenY);
        require(sent, "Falha ao transferir TokenY para o usuario");

        emit Swap(msg.sender, amountOfTokenX, amountOfTokenY);
    }

    function withdrawTokens() external onlyOwner {
        uint256 tokenXBalance = tokenX.balanceOf(address(this));
        uint256 tokenYBalance = tokenY.balanceOf(address(this));

        if (tokenXBalance > 0) {
            tokenX.transfer(msg.sender, tokenXBalance);
        }

        if (tokenYBalance > 0) {
            tokenY.transfer(msg.sender, tokenYBalance);
        }
    }
}

